import React, { Suspense, useEffect, useState } from "react";
import { Box } from "@mui/material";

import { useParams } from "react-router-dom";
import ResponsiveLayout from "../../ResponsiveLayout/ResponsiveLayout";
import { TestChartContainer } from "./testChartContainer";

const layoutInitialTwo = [
  { w: 5, h: 7, x: 5, y: 0, i: "a", static: false },
  { w: 5, h: 7, x: 0, y: 0, i: "b", static: false },
  { w: 2, h: 2, x: 8, y: 7, i: "c", static: false },
  { w: 2, h: 2, x: 8, y: 9, i: "d", static: false },
  { w: 8, h: 10, x: 0, y: 7, i: "e", static: false },
];

const PageLayoute = () => {
  const [currentPage, setCurrentPage] = useState();
  const { page, sub, group } = useParams();
  useEffect(() => {
    if (group) {
      setCurrentPage(group);
      return;
    }
    if (sub) {
      setCurrentPage(sub);
      return;
    }
    if (page) {
      setCurrentPage(page);
      return;
    }
  }, [page, sub, group]);

  return (
    <Box sx={{ width: "100%" }}>
      <h1>{currentPage}</h1>
      <ResponsiveLayout layoutData={layoutInitialTwo}>
        {layoutInitialTwo.map((elem) => (
          <TestChartContainer key={elem.i} />
        ))}
      </ResponsiveLayout>
    </Box>
  );
};

export default PageLayoute;
